    false,nt"url": null,nt"notes": "This framework for managing bison by the
    Department of the Interior (DOI) bureaus articulates a basis for improved management
    of the species and provides a foundation to strengthen existing and build new partnerships
    with States, Native American tribes, landowners, agricultural interests, conservationists
    and others interested in bison. The framework establishes steps to address the health
    and genetic composition of DOI bison herds, and acknowledges the ecological and
    cultural role of bison on the American landscape. It proposes specific actions to
    better manage and integrate bison populations on select Interior lands in 2008 and
    future years.",nt"license_title": "License Not Specified",nt"extras":
